import React from "react";
import '../hoja-de-estilos/Producto.css';
import Footer from './Footer.jsx';
import Navegacion from './Navegacion';

/* Todo componente debe iniciar con mayusculas*/
function Producto(props) {
  const [nombre, setNombre]=useState("");
  const [precio, setPrecio]=useState(0);
  const [id, setId]=useState(0);

  const [productosList,setProductos] =useState([]);

  const getEmpleados = () =>{
    Axios.get("http://localhost:3001/read").then((response)=>{
      setProductos(response.data);        
    });
}
  
  return(
    <div className="contenedor-productos">
      <div className='listar'>
        <table className="table table-striped">
          <thead>
            <tr>
              <th scope="col">Producto</th>
              <th scope="col">Descripción</th>
              <th scope="col">Disponible</th>
              <th scope="col">Acciones</th>
            </tr>
          </thead>
          {
            productosList.map((val,key)=>{
              return  <tr>
                        <th scope="row">{val.id}</th>
                        <td>{val.nombre} </td>
                        <td>{val.precio} </td>
                        <td>
                          <button type="button" className="btn btn-info">Editar</button>
                          <button type="button" className="btn btn-danger">Eliminar</button>
                        </td>
                      </tr>
            })
          }
        </table>
      </div>

        <img className="imagen-producto" src={require(`../imagenes/productos/pro${props.imagen}.png`)}/>
        <div className="contenedor-texto">
            <p className="nombre-producto">{props.nombre}</p>
            <p className="descripcion-producto"> {props.descripcion}</p>
        </div>
        <div>
        </div>
    </div>
  );
};

function AppProducto() {
    return (
      <div className="App">
        <Navegacion/>
        <br/><br/>
        <div className="contenedor-productos">
          <Producto
            imagen = "1"
            nombre = "Camisa negra"
            descripcion = "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec accumsan orci tincidunt nulla commodo maximus. Nullam ut semper ante, ut."
          />
        </div>
        <div className="contenedor-productos">
        <Producto
          imagen = "2"
          nombre = "Camisa Roja"
          descripcion = "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec accumsan orci tincidunt nulla commodo maximus. Nullam ut semper ante, ut."
        />
        </div>
        <div>
        <Producto
          imagen = "3"
          nombre = "Zapatos Converse"
          descripcion = "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec accumsan orci tincidunt nulla commodo maximus. Nullam ut semper ante, ut."
        />
        <Producto
          imagen = "4"
          nombre = "Gafas negras"
          descripcion = "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec accumsan orci tincidunt nulla commodo maximus. Nullam ut semper ante, ut."
        />
        </div>
        
        <Footer/>
      </div>
    );
};  


export default AppProducto;
